import React from 'react'

import Button from './Button'

const App = (props) => {
  const handleClick = e => {
    e.preventDefault()
    // Do something
  }

  return (

    <Button onClick={handleClick}>
      123
    </Button>
    // We want a button that routes to a new URL here
  )
}

export default App
